import React, { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";
function App() {
  const [post, setPost] = React.useState(null);
  useEffect(() => {
    axios.get("/api/menu/items/").then((response) => {
      setPost(response.data);
    });
  }, []);
  if (!post) return null;
  return (
    <div>
      <h1>{post[0].title}</h1>
      <p>{post[0].description}</p>
    </div>
  );
}
export default App;
